import React from 'react'
import styled from "styled-components";

import logo from "../../assets/noun_sink_1101346.png";

const Brand = () => {
    return (
        <Image src={logo} alt="Bathroom Finder Logo" />
    )
};

export default Brand

const Image = styled.img`
  height: 85%;
  margin: auto 0;
`;
